protos.proto_content:
syntax = "proto3";
package shapes;
option go_package = "./shapes";

import "params/triangle.proto";
import "params/rectangle.proto";
import "params/square.proto";



service ShapeCalculator {
  rpc CalculateTriangleArea(shapes.params.Triangle) returns (Area) {}
  rpc CalculateRectangleArea(shapes.params.Rectangle) returns (Area) {}
  rpc CalculateSquareArea(shapes.params.Square) returns (Area) {}
}

message Area {
  float value = 1;
}

