pre_tasks.data:
apt.environment.set("脚本-预执行", "1111");//设置一个环境变量

console.log(apt.environment.get("test"))//获取一个环境变量)

apt.environment.delete("删除");//删除一个环境变量

console.log(apt.environment.getPreUrl())//获取当前前置URL

console.log(apt.environment.getName())//获取当前环境名称

console.log(apt.environment.getCollection())//获取当前环境变量集合

// // apt.environment.clear();//清空环境变量

console.log(apt.variables.get("test"))//获取一个变量(优先级环境变量>全局变量)

apt.globals.set("脚本预执行", "22222");//设置一个全局变量

console.log(apt.globals.get("body"))//获取一个全局变量

apt.globals.delete("删除");//删除一个全局变量

// // apt.globals.clear();//清空全局变量

apt.setRequestQuery("She-zhi", "AAAAA");//设置一个请求query

apt.removeRequestQuery("query1111");//删除一个请求query

apt.setRequestHeader("Meng_yu", "BBBB");//设置一个请求头

apt.removeRequestHeader("AAAA");//删除一个请求头

apt.setRequestBody({ "key": "value" }); //将body设置为Key/Value--body必须为raw时才会生效

try {
	const response = await apt.sendRequest({
		url: "https://httpbin.org/anything",
		method: "GET"
	});

	console.log(response.json());
} catch (err) {
	console.error(err);
}//发送一个请求

post_tasks.data:
console.log(apt.environment.get("url"))//获取一个环境变量

console.log(apt.globals.get("body"))//获取一个全局变量

console.log(apt.variables.get("url"))//获取一个变量

apt.environment.set("variable_Huan", "1111");//设置一个环境变量

apt.globals.set("variable_Quan", "222");//设置一个全局变量

apt.environment.unset("删除");//删除一个环境变量

apt.globals.unset("删除002");//删除一个全局变量

try {
  const response = await apt.sendRequest({
    url: "https://httpbin.org/anything",
    method: "GET"
  });

  console.log(response.json());
} catch (err) {
  console.error(err);
}//发送一个请求

apt.test("响应码为 200", function () {
  apt.response.to.have.status(200);
});//断言响应码为 200

apt.test("正文匹配含有字符串", function () {
  apt.expect(apt.response.text()).to.include("MENGYU");
});//断言正文匹配含有字符串MENGYU

apt.test("响应json的errstr字段值为'success'", function () {
  var jsonData = apt.response.json();
  apt.expect(jsonData.errstr).to.eql("success");
});//断言响应json的errstr字段值为'success'"

apt.test("响应体等于一个字符串", function () {
  apt.response.to.have.body("response_body_string");
});//断言响应体等于一个字符串----------------------------------------------

apt.test("存在响应头 Content-Type", function () {
  apt.response.to.have.header("Content-Type");
});//断言存在响应头 Content-Type

apt.test("响应时间小于 200ms", function () {
  apt.expect(apt.response.responseTime).to.be.below(200);
});//断言响应时间小于 2000000000ms

apt.test("成功的POST请求", function () {
  apt.expect(apt.response.code).to.be.oneOf([200, 202]);
});//断言是一个成功的POST请求

apt.test("状态码包含字符串", function () {
  apt.response.to.have.status("200");
});//断言状态码包含字符串200

