protos.proto_content:
//__ReflectionProtoName:user.proto
syntax = "proto3";

package proto;


option go_package = "./";

message UserRequest {
  string name = 1;
}
message UserResponse {
  int32 id = 1;
  string name = 2;
  int32 age = 3;
  repeated string hobby = 4;
}
message NameRequest {
  int32 id = 1;
}
message NameResponse {
  string name = 1;
}
service UserInfoService {
  rpc GetUserInfo (proto.UserRequest) returns (proto.UserResponse);
  rpc GetUserName (proto.NameRequest) returns (proto.NameResponse);
}

