var token = apt.environment.get("token")
if (token) {
    console.log(token)
    apt.request.headers.add({
        key: 'Authorization',
        value: token
    })
} else {
    console.log("没有token")
}
//检查环境变量中是否存在token，就将它作为授权信息添加到HTTP请求的头部；如果不存在，就输出提示信息。

await $.ajax({
	"url":"https://echo.apipost.cn/token.php",
	"method":"POST",
	"content-type":"appication/json",
	"data":JSON.stringify({
		"email":"admin@admin.com", 
		"password":"密码"
	}),
	"success":function(response){
		response = typeof response == "object" ? response : JSON.parse(response);
		console.log(response);
		apt.variables.set("token", response.token);
	}
});

